import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";

import Carousels from "./carousel";

class About extends Component {
  render() {
    return (
      <div>
        <Grid>
          <Cell col={4}>
            <Carousels />
          </Cell>

          <Cell className="about-right-col" col={4}>
            <h2>About</h2>
            L'azienda Trasporti Amatrudo S.r.l. si trova in VIA ZECCAGNUOLO, 19,
            84010, San Valentino Torio, Salerno. La sua attività è Codice Ateco
            2007 (49.41) "Trasporto di merci su strada". Il report aggiornato è
            stato emesso il 28/01/2015.
            <hr />
            La forma giuridica della società Trasporti Amatrudo S.r.l. è
            "SOCIETA' A RESPONSABILITA' LIMITATA - Società di capitale".
          </Cell>
          <Carousels />
        </Grid>
      </div>
    );
  }
}

export default About;
